import { connect } from "react-redux";
import axios from "axios";
class InforMationViewModel {
    private url:string;
    constructor () {
        this.url = "127.0.0.1:3000/krx/api/list/1";
    }

    async getStockList () {
        const response = await axios.get("http://127.0.0.1:3000/krx/api/list/1");
        console.log(response);
    }
}

const inforMationViewModel =  new InforMationViewModel();
export const getStockList = inforMationViewModel.getStockList.bind(inforMationViewModel);
